def lin_reg0(**kwargs):
    """
    f(x) = a
    """
    n     = kwargs["n"    ]
    S_y   = kwargs["S_y"  ]
    a = S_y/n
    return [a]

def lin_reg1(**kwargs):
    """
    f(x) = a + b*x
    """
    n     = kwargs["n"    ]
    S_x   = kwargs["S_x"  ]
    S_x2  = kwargs["S_x2" ]
    S_y   = kwargs["S_y"  ]
    S_xy  = kwargs["S_xy" ]
    delta1 = -S_x**2 + S_x2*n
    a = -(S_x*S_xy - S_x2*S_y)/delta1
    b = (-S_x*S_y + S_xy*n)/delta1
    return [a,b]


def lin_reg2(**kwargs):
    """
    f(x) = a + b*x + c*x**2
    """
    n     = kwargs["n"    ]
    S_x   = kwargs["S_x"  ]
    S_x2  = kwargs["S_x2" ]
    S_x3  = kwargs["S_x3" ]
    S_x4  = kwargs["S_x4" ]
    S_y   = kwargs["S_y"  ]
    S_xy  = kwargs["S_xy" ]
    S_x2y = kwargs["S_x2y"]
    delta2 = -S_x**2*S_x4 + 2*S_x*S_x2*S_x3 - S_x2**3 + S_x2*S_x4*n - S_x3**2*n
    a = (S_x*S_x2y*S_x3 - S_x*S_x4*S_xy - S_x2**2*S_x2y + S_x2*S_x3*S_xy + S_x2*S_x4*S_y - S_x3**2*S_y)/delta2
    b = -(-S_x*S_x2*S_x2y + S_x*S_x4*S_y + S_x2**2*S_xy - S_x2*S_x3*S_y + S_x2y*S_x3*n - S_x4*S_xy*n)/delta2
    c = (-S_x**2*S_x2y + S_x*S_x2*S_xy + S_x*S_x3*S_y - S_x2**2*S_y + S_x2*S_x2y*n - S_x3*S_xy*n)/delta2
    return [a,b,c]

